      font-size: 36px;
    }

      padding: 10px;

      justify-content: center;
      gap: 20px;
    }
    .car-box {
      background: white;
      padding: 10px;
      border-radius: 10px;
      box-shadow: 0 4px 8px rgba(0,0,0,0.1);
      width: 250px;
    }
    .car-box img {
      width: 100%;
      height: 180px;
      border-radius: 10px;
      object-fit: cover;
      transition: transform 0.3s ease;
    }
    .car-box img:hover {
      transform: scale(1.05);
    }
    .car-box p {
      margin-top: 10px;
      font-weight: bold;
      color: #0a3d62;
    }
    .contact-section {
      background: #3c6382;
      color: white;
      padding: 40px 20px;
    }
    form {
      background: white;
      max-width: 500px;
      margin: auto;
      padding: 20px;
      border-radius: 10px;
      color: black;
    }
    input, select, button {
      width: 100%;
      padding: 10px;
      margin: 10px 0;
      border-radius: 5px;
      border: 1px solid #ccc;
    }
    button {
      background-color: #1e3799;
      color: white;
      border: none;
      cursor: pointer;
    }
    button:hover {
      background-color: #0a3d62;
    }
  </style>
